import React from "react";
import {Link} from 'react-router-dom';
function PageRestaurant(){
    
    return(
        <div>
            <h1>Este es el componente de restaurant</h1>
            <div className="principalRestaurant">
                <Link to="/prueba">IR</Link>
                    <img src="/img/casa.png" alt="" style={{cursor:"pointer"}}/>
            </div>
        </div>
    )
}

export default PageRestaurant;
